        username: '',
        email: '',
        password: '',
        currency: '',
        keywords: [],
        cryptocurrencies: []
    };
  }


  componentDidMount(){

    // make API call
    e.preventDefault()
    console.log(this.state)
    axios.get('http://localhost:6200/users/profile',{headers : localStorage.getItem("auth-token")})
    .then(response=>{
      console.log(response)
    })
    .catch(error =>{
      console.log(error)
    })



    }

  render(){
    return (
      <div>
      <h1>My {this.state.username}</h1>
      <p>
        It is a {this.state.email}
        {this.state.password}
        from {this.state.currency}.
      </p>
    </div>

    );
  }
}


export default Profil;
